import { IconButton, List, Typography } from "@mui/material";
import DashboardIcon from '@mui/icons-material/Dashboard';
import { StyledListItemButton } from "../../styles/dashboard/DashboardAccordian";
import { MiddleDivider } from "../../styles/dashboard/DashboardSidebar";
import ProductionQuantityLimitsIcon from '@mui/icons-material/ProductionQuantityLimits';
import AddIcon from '@mui/icons-material/Add';
import PersonIcon from '@mui/icons-material/Person';
import EditIcon from '@mui/icons-material/Edit';
import { NavLink } from "react-router-dom";
import { useUIContext } from "../../context/ui";

export default function SidebarAccordian(){

    const {barActive} = useUIContext();

return(
    <>
    <List>
        <StyledListItemButton LinkComponent={NavLink} to="/admin/dashboard"><IconButton><DashboardIcon/> </IconButton> <Typography sx={{ display: barActive ? 'block' : 'none' }}>Dashboard</Typography> </StyledListItemButton>
        <MiddleDivider variant="midle"/>
        <StyledListItemButton LinkComponent={NavLink} to="/admin/dproducts"><IconButton><ProductionQuantityLimitsIcon/> </IconButton> <Typography sx={{ display: barActive ? 'block' : 'none' }}>Products</Typography></StyledListItemButton>
        <MiddleDivider variant="midle"/>
        <StyledListItemButton LinkComponent={NavLink} to="/admin/addproducts"><IconButton><AddIcon/> </IconButton> <Typography sx={{ display: barActive ? 'block' : 'none' }}>Add Products</Typography> </StyledListItemButton>
        <MiddleDivider variant="midle"/>
        <StyledListItemButton LinkComponent={NavLink} to="/admin/user"><IconButton><PersonIcon/> </IconButton> <Typography sx={{ display: barActive ? 'block' : 'none' }}>Users</Typography>   </StyledListItemButton>
        <MiddleDivider variant="midle"/>
        <StyledListItemButton LinkComponent={NavLink} to="/admin/editdata"><IconButton><EditIcon/> </IconButton> <Typography sx={{ display: barActive ? 'block' : 'none' }}>Edit Data</Typography>   </StyledListItemButton>
        <MiddleDivider variant="midle"/>
    </List>
    </>
)

}
